import React from "react";
import style from "./SliderOnlyOne.module.css"
import $ from "jquery";
function SliderOnlyOne(){
    const $jq = jQuery.noConflict()
    $jq('.slider-for').slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: false,
        fade: true,
        asNavFor: '.slider-nav'
    });
    $jq('.slider-nav').slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        asNavFor: '.slider-for',
        dots: true,
        focusOnSelect: true
    });

    $jq('a[data-slide]').slick(function(e) {
        e.preventDefault();
        var slideno =  $jq(this).data('slide');
        $jq('.slider-nav').slick('slickGoTo', slideno - 1);
    });
    return(
        <div className={style.main}>
            <div className="slider slider-for">
                <div><h3>1</h3></div>
                <div><h3>2</h3></div>
                <div><h3>3</h3></div>
                <div><h3>4</h3></div>
                <div><h3>5</h3></div>
            </div>
            <div className="slider slider-nav">
                <div><h3>1</h3></div>
                <div><h3>2</h3></div>
                <div><h3>3</h3></div>
                <div><h3>4</h3></div>
                <div><h3>5</h3></div>
            </div>
            <div className="action">
                <a href="#" data-slide="3">go to slide 3</a>
                <a href="#" data-slide="4">go to slide 4</a>
                <a href="#" data-slide="5">go to slide 5</a>
            </div>
        </div>
    )
}
export default SliderOnlyOne
